import React from "react";
import "./Login.css";

export const Login = () => {
  return (
    <div className="todo-container">
      <form>
        <div>
          <input type="text" name="username" placeholder="Username" />
        </div>
        <input type="text" name="password" placeholder="Password" />
        <input type="submit" />
      </form>
    </div>
  );
};
